* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

a {
  text-decoration: none;
  color: inherit;
  display: inline-block;
}

img {
  width: 100%;
  vertical-align: top;
}

svg {
  vertical-align: top;
}

