                    }
                }

                .service-title {
                    text-transform: uppercase;
                    color: $color-white-primary;
                    margin: 0;
                }
            }

            &__body {

                padding: 2rem 2rem 3rem 2rem;

                .service-list {
                    margin-bottom: 3rem;

                    &__item {
                        list-style: none;
                        border-bottom: 1px solid $color-white-tertiary;
