                        svg {
                            margin-right: 0.7rem;
                            color: inherit;
                            font-size: 1.3rem;
                        }
                    }
                }

                .service-anchor {
                    text-align: center;

                    .anchor {
                        text-transform: uppercase;
                        font-weight: 600;
